import { setState } from 'react';

function Modal() {
  const [cancel, setCancel] = setState(false);
  function cancelModal() {
    setCancel = true
  }
  return (
    <div className="modal">
      <p>Are you sure?</p>
      <button className="btn btn--alt" onClick={cancel}>Cancel</button>
      <button className="btn">Confirm</button>
    </div>
  );
}

export default Modal;
